import { Link } from 'react-router-dom';
import SearchBar from '../SearchBar/SearchBar.js';
import * as S from './NavBar.styled.js'

export default function NavBar() {

  return (
    <S.NavBar >
      <div> 

      </div>

      <SearchBar/>

      <S.Buttons> 
          <S.CreateButton>
        <Link to='/recipe/create'>
            CREAR
        </Link >
          </S.CreateButton>

          <S.HomeButton>
        <Link to='/'>
            HOME
        </Link >
          </S.HomeButton>
      </S.Buttons>
    </S.NavBar>
  )
};
